import React from "react";

import "./App.css";

function App() {
    
  const InputEvent = (event) => {
    console.log(event.target.value);
  };
  return (
    <>
      <div>
        <h1>Hello</h1>
        <input
          type="text"
          placeholder="Enter Your Name"
          onChange={InputEvent}
        ></input>
        <button>Submit</button>
      </div>
    </>
  );
}

export default App;
